def stats(name, age):
    # Get player URL
    url = player_links.get(name)
    
    if not url:
        return {"error": f"Player '{name}' not found"}

    response = requests.get(url, headers)
    soup = BeautifulSoup(response.content, 'html.parser')

    # Find tables by their IDs
    per_game_table = soup.find('table', {'id': 'per_game0'})
    per_100_table = soup.find('table', {'id': 'per_poss0'})
    advanced_table = soup.find('table', {'id': 'advanced0'})

    # Initialize stats dictionary
    player_stats = {
        "name": name,
        "url": url,
        "age": age,
        "per_game": None,
        "per_100_possessions": None,
        "advanced": None
    }

    # Helper: filter by age if column exists
    def filter_by_age(df, age):
        for col in df.columns:
            if 'Age' in col:
                df = df[df[col] == int(age)]
                break
        return df

    # Extract Per Game Stats
    if per_game_table:
        df_per_game = pd.read_html(str(per_game_table))[0]
        player_stats["per_game"] = filter_by_age(df_per_game, age).to_dict('records')
        if player_stats["per_game"] == [] or player_stats["per_game"] is None:
            return {"error": f"No stats found for age {age}"}
        else:
            del player_stats["per_game"][-1]['Awards']  # Remove awards columns
            keys_to_delete = [k for k in player_stats["per_game"][-1] if 'Unnamed' in k]
            for key in keys_to_delete:
                del player_stats["per_game"][-1][key]
            player_stats["per_game"] = {k: float(v) if k != 'Tm' and isinstance(v, (int, float)) else v for k, v in player_stats["per_game"][-1].items()}
        
    # Remove awards columns

    # Extract Per 100 Possessions Stats
    if per_100_table:
        df_per_100 = pd.read_html(str(per_100_table))[0] # this is the line with the issue
        player_stats["per_100_possessions"] = filter_by_age(df_per_100, age).to_dict('records')
    
    # Extract Advanced Stats
    if advanced_table:
        df_advanced = pd.read_html(str(advanced_table))[0]
        player_stats["advanced"] = filter_by_age(df_advanced, age).to_dict('records')
        if player_stats["advanced"] == [] or player_stats["advanced"] is None:
            return {"error": f"No stats found for age {age}"}
        else:
            keys_to_delete = [k for k in player_stats["advanced"][-1] if 'Unnamed' in k]
            for key in keys_to_delete:
                del player_stats["advanced"][-1][key]
            player_stats["advanced"] = {k: float(v) if k != 'Tm' and isinstance(v, (int, float)) else v for k, v in player_stats["advanced"][-1].items()}

    # Remove the last dictionary because its career stats
    print(player_stats)
    return player_stats


def compare(name1, age):
    most_similar_score = -1  # Initialize with a very low value
    player1 = stats(name1, age)
    for key in player_links.keys():
        player2 = stats(key, age)

        if "error" in player1 or "error" in player2:
            continue
        # Convert stats to DataFrames
        keys = ['per_game', 'advanced']

        # 2. Convert dicts to vectors
        vec1 = np.array([player1[k][key] if key != 'Tm' and not (pd.isna(player1[k][key]) and not (None)) else 0 for k in keys for key in player1[k]]).reshape(1, -1)
        vec2 = np.array([player2[k][key] if key != 'Tm' and not (pd.isna(player2[k][key]) and not (None)) else 0 for k in keys for key in player2[k]]).reshape(1, -1)

        # Replace NaN with 0.0 in both vectors
        vec1_replaced = np.nan_to_num(vec1)
        vec2_replaced = np.nan_to_num(vec2)
        # 3. Compute cosine similarity
        similarity = cosine_similarity(vec1_replaced, vec2_replaced)
        similarity = similarity[0][0] 
        # Extract the scalar value from the 2D array
        if similarity > most_similar_score and player1["name"] != player2["name"]:
            most_similar_player = player2
            most_similar_score = similarity
    return {
        "player1": player1["name"],
        "player2": most_similar_player["name"],
        "similarity_score": float(most_similar_score),
    }

# Example usage:
print(compare("A'ja Wilson", "25"))
